import { REGISTER_SUCCESS, REGISTER_FAIL } from './types';
import axios from 'axios';

// Load User
export const loadUser = () => console.log('loaduser');

// Register User
export const registerUser = async (formData, dispatch) => {
  const config = {
    headers: {
      'Content-Type': 'application/json',
    },
  };

  try {
    const res = await fetch('/api/users', formData, config);
    const data = await res.json();

    dispatch({
      type: REGISTER_SUCCESS,
      payload: data,
    });
  } catch (err) {
    dispatch({
      type: REGISTER_FAIL,
      payload: err.response.data.msg,
    });
  }
};

// Login User
export const login = () => console.log('login');

// Logout User
export const logout = () => console.log('logout');

// Clear Errors
export const clearErrors = () => console.log('clearErrors');
